import React from "react";
import { FaArrowDown, FaArrowUp } from "react-icons/fa";

const CompletedProjects = (
  projects,
  onShow,
  showTasks,
  onDelete,
  onComplete
) => {
  return (
    <div>
      <h2
        className="main"
        onClick={onShow}
        style={{ color: "white", backgroundColor: "black" }}
      >
        Completed Projects {showTasks ? <FaArrowUp /> : <FaArrowDown />}
      </h2>
      {projects.length > 0
        ? projects.map(
            (project) =>
              showShort && (
                <div className="Task">
                  <h3>{project.text}</h3>
                </div>
              )
          )
        : showShort && <h3 className={"task"}>No Tasks</h3>}
    </div>
  );
};

export default CompletedProjects;
